import React from "react";

const favlist = ({user, users, setlistUpdated}) =>{

    const handleFavoritos = Id => {

        //consulta
        const requestInit = {
            method:'PUT',
            headers: {'Content-Type': 'application/json'},
            body: JSON.stringify(userFav)
        }
        fetch('http://localhost:9000/quitarfavoritoContacto/' + Id,requestInit)
        .then(res => res.json())
        .then(res => console.log(res))

        setlistUpdated(true)
    }

    return (
        <table className="table">
            <thead>
                <tr>
                    <th>Id</th>
                    <th>Nombre</th>
                    <th>Apellido</th>
                    <th>Telefono</th>
                    <th>Correo</th>
                </tr>
            </thead>
            <tbody>
                {users.map(usersFav => (
                    <tr key = {usersFav.Id}>
                        <td>{usersFav.Id}</td>
                        <td>{usersFav.Nombres}</td>
                        <td>{usersFav.Apellidos}</td>
                        <td>{usersFav.Telefono}</td>
                        <td>{usersFav.Correo}</td>
                        <td>
                            <div className="mb-3">
                                <button onClick={ () => handleFavoritos(usersFav.Id)} className="btn btn-danger">Favoritos</button>
                            </div>
                        </td>
                    </tr>
                ))}
            </tbody>
        </table>
    );
}

export default favlist;
